  return (
      <Layout
        title="Shop Page"
        description="Search and find books of your choice"
        className="container-fluid"
      >
      <div className="row">
        <div className="col-4">Left sidebar</div>

        <div className="col-8">Right sidebar</div>
      </div>
      </Layout>
  );

};

export default Shop;
